SafeAddString(SI_DELETE_CHARACTER_DIALOG_GAMEPAD_TEXT, "Вы можете удалить еще <<1>> <<1[персонажей/персонажа/персонажей/персонажей]>>.\n\n|cff9633После удаления персонажа всего его предметы, купленные в кронном магазине или полученные с помощью кодов активации, пропадут с вашей учетной записи.|r\n\nЕсли вы хотите сохранить эти предметы, посетите банкира и оставьте их у него.\n\nКоллекционные предметы — вроде верховых животных, питомцев, костюмов и улучшений учетной записи — останутся у вас.\n\nСнаряжение персонажа и предметы в его инвентаре будут уничтожены.", 1)
SafeAddString(SI_DELETE_CHARACTER_DIALOG_GAMEPAD_TITLE, "Удаление персонажа", 0)
SafeAddString(SI_DELETE_CHARACTER_DIALOG_TEXT, "|cff0000Удаление персонажа, у которого есть предметы, купленные за кроны или полученные с помощью кодов активации, приведет к тому, что эти предметы будут потеряны навсегда.|r\n\nКоллекционные предметы, такие как верховые животные, питомцы, костюмы и расширения, утеряны не будут. Снаряжение персонажа и предметы в его инвентаре будут уничтожены. Если вы хотите сохранить их, посетите банкира и оставьте их у него.\n\nВ данный момент вы можете удалить |cFFFFFF<<4>>|r <<4[персонажей/персонажа/персонажей/персонажей]>>.\n\nВ дальнейшем вам станут доступны дополнительные удаления.\n\nВы уверены, что хотите удалить |cFFFFFF<<1>>|r? Для подтверждения напечатайте |cFFFFFF<<2>>|r в поле ниже и нажмите <<3>>.", 3)
